import React from 'react';
import styled from 'styled-components';


const Tr = styled.tr`

    border-bottom: 1px solid #dddddd;
    &:hover {
        background-color: #f3f3f3;
    }
`;

const Td = styled.tr`
    padding: 12px 15px;
`;


const Customer = (props) => {
    return (

        <Tr>
            <td className="td">
                {props.id}
            </td>
            <td className="td">
                {props.name}
            </td>
            <td className="td">
                {props.birthday}
            </td>
            <td className="td">
                {props.gender}
            </td>
            <td className="td">
                {props.job}
            </td>
        </Tr>

    )
}



export default Customer;
